import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  root: {
    display: 'flex',
    maxWidth: '100%',
    // maxHeight: '100%',
    height: '100%'
  },
  media: {
    height: 250,
    paddingTop: '56.25%',
  },
  cardActions: {
    display: 'flex',
    justifyContent: 'flex-end',
    flex: 1,
    // marginBottom: 36
  },
  cardContent: {
    display: 'flex',
    justifyContent: 'space-between',
  },
}));
